import React from "react";

export default function Navbar(props) {
  return (
    <>
      <nav class="navbar navbar-expand-lg navbar-light bg-light">
        <h6>
          {props.name}
        </h6>
        <div class="collapse navbar-collapse" id="navbarText">
          <ul class="navbar-nav mr-auto">
            <li class="nav-item">
              <h6>
                {props.dob}
              </h6>
            </li>
            <li class="nav-item">
              <h6>
                {props.tier}
              </h6>
            </li>
            <li style={{ marginLeft: '.8rem', marginTop:'.6rem'}}>
            <h6>TOTAL COUNT: <span class="badge bg-secondary">New</span></h6>
            </li>
          </ul>
        </div>
      </nav>
    </>
  );
}
